The coordinates of point \(D\) are \((0, -1, 0)\). The distance \(PD\) is given by the distance formula in three dimensions:
\[
PD = \sqrt{(x_2 - x_1)^2 + (y_2 - y_1)^2 + (z_2 - z_1)^2}
\]
Substituting the coordinates of \(P\) and \(D\):
\[
PD = \sqrt{(1.2 - 0)^2 + (1.5 - (-1))^2 + (1 - 0)^2} = \sqrt{(1.2)^2 + (1.5 + 1)^2 + (1)^2} = \sqrt{(1.2)^2 + (2.5)^2 + (1)^2}
\]
Calculating the squares:
\[
(1.2)^2 = 1.44, \quad (2.5)^2 = 6.25, \quad (1)^2 = 1
\]
Adding these values together:
\[
1.44 + 6.25 + 1 = 8.69
\]
Taking the square root of 8.69:
\[
PD = \sqrt{8.69} = 2.95
